import './App.css';

function App() {
  return (
    <div className="App">
    <h1>GEORGIA QUIZ</h1>      


    <h2>CURRENT SCORE : 2</h2>

    <div className='questioncard'>
       <h2>QUESTION 1 OUT OF 5</h2>
    <h3>WHAT IS THE OLDEST CAPITAL OF GEORGIA</h3>

    <ul>
      <li>ქუთაისი და იგი და იგი</li>
      <li>თბილისი ბრაატ</li>
      <li>ბათუმი და ჭო</li>
      <li>ხაშური ბიჯო მაა</li>
    </ul>
    </div>






    </div>
  );
}

export default App;
